import React from 'react';
import './App.css';

import { BrowserRouter } from 'react-router-dom';
import { RouterConfig } from "./navigation/RouterConfig";

const App: React.FC = () => {
  return (
    <>
      <div>
          <BrowserRouter>
            <RouterConfig />
          </BrowserRouter>
      </div>
    </>
  );

};

export default App;
